import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages';
import SigninPage from './pages/signin'
import SearchPage from './pages/search'
import BlogPage from './pages/ฺฺBlogpages/blog1';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home/>} exact />
        <Route path="/signin" element={<SigninPage/>} exact />
        <Route path="/search" element={<SearchPage/>} exact />
        <Route path="/blog/1"  element={<BlogPage1/>} exact />
        <Route path="/blog/2"  element={<BlogPage2/>} exact />
        <Route path="/blog/3"  element={<BlogPage3/>} exact />
        <Route path="/blog/4"  element={<BlogPage4/>} exact />
        <Route path="/blog/5"  element={<BlogPage5/>} exact />
        <Route path="/blog/6"  element={<BlogPage6/>} exact />
      </Routes>
    </Router>
  );
}

export default App;
